        "descriptionDe": "Rezo ist vor allem dank seiner politischen „Zerstörungs-Videos“ einer der bekanntesten Creator Deutschlands. Schon seit 2015 sammelt er auf Youtube Millionen-Reichweiten und baut gerade bereits seinen dritten Kanal auf. Auf seinen Kanälen verzeichnet er knapp vier Millionen Follower und in Summe etwa 550 Millionen Views. Nicht nur mit den bekannten Politik-Videos bindet er seine Community – aber sein tägliches Brot sind unterhaltsame Videos, die einfach Spaß machen sollen. ",
        "descriptionEn": "Thanks to videos featuring him criticizing the current state of politics, Rezo has become one of Germany’s most well-known creators. His story dates back to 2015, when already then he was generating views in the millions and is now on his third YouTube channel. Across all channels, he has a total of roughly 4 million subscribers and over 550 million views. But it’s not all politics that his flourishing community has come to expect—he’s also known for entertaining videos that are just for fun. ",
