        "name": "David Fischer",
        "descriptionDe": "Highsnobiety ist eine global anerkannte Style-Instanz, die Bibel für Hypebeasts und Sneakerheads – für junge, solvente Streetwear-Fans, wie Mode heute wieder genannt wird. Gegründet wurde das Digitalmagazin von einem Deutschen: David Fischer. Der hatte vor 17 Jahren einen Fashion-Blog ins Netz gebracht. Heute erklären er und seine 160 Mitarbeitenden nicht nur der Welt, was gerade en vogue ist. Mit eigenen Kollabo-Produkten mischen die Berliner im DTC-Business mit, sie erfinden digitale Fashion-Events neu und helfen Unternehmen aus allen Industrien, die wirklich wichtigen Kund:innen zu erreichen. Es dürfte aktuell nur wenige andere Menschen geben, die besser als Fischer wissen, wie man heutzutage eine Lifestyle-Marke aufbaut, pflegt und bei der jungen Zielgruppe relevant macht.",
        "descriptionEn": "Highsnobiety is a globally recognized style brand, a bible for hypebeasts and sneakerheads—and for young, solvent streetwear fans, aka fashion freaks. David Fischer founded the digital magazine 17 years ago. Today, Fischer and his team of 160 are tastemakers par excellence. With exclusive collections, Highsnobiety is getting in on the DTC game, reinventing fashion events and aiding companies from all manner of industries to truly reach their clients. There figures only to be a handful of individuals who know more than Fischer does about establishing and finetuning a lifestyle brand —and how to make it relevant in the eyes of a young target group.",
