        "name": "Christoph Grainger-Herr",
        "descriptionDe": "Christoph Grainger-Herr ist seit 2006 bei IWC Schaffhausen und hatte verschiedene Positionen in unterschiedlichen Abteilungen, bevor er im April 2017 zum CEO von IWC Schaffhausen ernannt wurde. Dank seines Hintergrunds in Architektur und Design hat er eine sehr ästhetische Vision für die Marke. Sein kreatives Denken ist ein entscheidender Vorteil, nicht nur bei der Weiterentwicklung der ikonischen IWC-Uhrenfamilien, sondern auch beim Aufbau des emotionalen Storytellings von IWC Schaffhausen.",
