        "name": "Avery Akkineni",
        "descriptionDe": "Avery Akkineni ist President von Vanyer NFT, dem NFT-Zweig von Vayner Media, der Agenturgruppe von Marketing- und Business-Vordenker Gary Vaynerchuk. Die Agentur unterstützt seit Juli 2021 Marken und Unternehmen, Prominente und Sportler auf ihrem Weg in die Welt von Non Fungible Tokens (NFTs) und Web3. Startkunde war Budweiser; die erste NFT-Kollektion von Budweiser soll innerhalb von Stunden ausverkauft gewesen sein. Zuvor hat Akkineni zunächst sechs Jahre für Google gearbeitet, dann die Expansion von Vayner Media in der Region Asien-Pazifik verantwortet, dabei Büros in Singapur, Bangkok, Tokyo und Sydney eröffnet und ein Team von 150 Mitarbeiter:innen aufgebaut. ",
        "descriptionEn": "Avery serves as the President of Vayner NFT. She leads the company’s mission to build long-term strategic NFT projects for the world’s leading intellectual property owners serving brands, celebrities, athletes and associations looking to incentivize and reward brand advocacy and customer loyalty. Avery previously led VaynerMedia’s expansion into APAC, growing a team from 0-150+, opening offices in Singapore, Bangkok, Tokyo, and Sydney, and was awarded SEA Independent Agency of the Year, within 2 years. Prior to joining Vayner, she spent six years working at Google, in both Silicon Valley and New York City. Avery will drive meaningful cultural relevance for others to unlock the potential of one of the biggest technology shifts of our time.",
