        "name": "Lea-Sophie Cramer",
        "descriptionDe": "Lea-Sophie Cramer ist eine der deutschen Vorzeige-Digitalunternehmerinnen. Nach ihrem Berufseinstieg bei BCG und Rocket Internet gründete sie im Januar 2013 gemeinsam mit Sebastian Pollok das Startup Amorelie, eine moderne, digitalere Variante von Beate Uhse. U.a. mit geschickter PR gelingt es beiden, Umsatz und Gewinn des Unternehmens in den jeweils achtstelligen Bereich zu skalieren. 2019 steigt sie aus Amorelie aus und ist seitdem noch stärker als zuvor als Investorin tätig. Mit ihrer Beteiligungsfirma hat sie u.a. in die Startups Plus Dental, Lillydoo und Cleverly investiert. Cramer ist Mitglied des Beirats \"Junge Digitale Wirtschaft\" im Bundesministerium für Wirtschaft und Energie. Auf Linkedin folgen ihr knapp 160.000 Menschen. Gemeinsam mit der Unternehmerin und Investorin Verena Pausder ist Cramer Gastgeberin des Podcast \"Fast & Curious\". Aktuell bereitet die 34-Jährige die Gründung ihres nächsten Unternehmens vor.",
        "descriptionEn": "Lea-Sophie Cramer is one of the absolute top digital entrepreneurs in Germany. After getting her start at BCG and Rocket Internet, she founded Amorelie in 2013 together Sebastian Pollok. Thanks to a clever public relations strategy, the duo were able to grow both revenue and profit to the eight-figure range. She left Amorelie in 2019 and has since been primarily active as an investor. Through her holding company,  she has invested in Plus Dental, Lillydoo and Cleverly. Cramer is also member of the “Junge Digitale Wirtschaft\" committee for the German government and is followed by nearly 160,000 people in LinkedIn. Together with Varena Pausder, she hosts the “Fast & Curious” podcast. Currently, she is prepping the launch of her next venture. ",
