        "name": "Verena Pausder",
        "descriptionDe": "Verena Pausder ist Unternehmerin und Autorin. Sie hat 2012 die Firma Fox & Sheep gegründet, die digitale Produkte für Kinder entwickelt und deren Apps millionfach heruntergeladen worden sind. Seit 2015 gehört Fox & Sheep zu Haba. Unter dem Dach des Spielzeugherstellers hat die heute 42-Jährige die Haba Digital Werkstätten ins Leben gerufen und über mehrere Jahre als CEO geführt. 2017 hat Pausder den Digitale Bildung für Alle e.V. gegründet, der Kindern chancengleichen Zugang zu digitaler Bildung ermöglichen will. In ihrem 2020 veröffentlichten Spiegel-Bestseller \"Das Neue Land\" setzt sie sich mit Themen wie Digitalisierung, New Work, Politik und Klimaschutz auseinander. Gemeinsam mit der Unternehmerin und Investorin Lea-Sophie Cramer ist Pausder Gastgeberin des Podcast \"Fast & Curious\". Über ihren privaten Investment-Fonds ist Pausder an Ventures Fonds wie Project-A, Lakestar und Cherry Ventures sowie Firmen wie Wise, Knowunity und Simpleclub beteiligt.",
