        "name": "Saint Linh",
        "descriptionDe": "Saintlinh ist eine deutsche Content Creatorin mit vietnamesischen Wurzeln. Deshalb beginnt sie ihre Karriere auch als Sängerin in Südostasien, bevor sie mit Beginn der Pandemie im März 2020 wieder nach Deutschland zurückkehrt. Hier entdeckt sie TikTok als Kanal und baut sich schnell eine Community rund um ihre Liebe zu Musik, Fashion, Memes und Comedy auf. Dabei steht sie auch für die asiatische Community in Deutschland und ist auch für die zu einem Vorbild geworden.",
        "descriptionEn": "Saintlinh is a German content creator of Vietnamese descent. She previously jumpstarted her career as a music artist in South East Asia before returning to her home in Germany after the start of the pandemic in March 2020. She found a new outlet through TikTok and soon was loved by the community with her fun loving attitude and sharing music, fashion, meme and comedy content. As one of the most successful Asian faces in the German creator community she is a trailblazer for representation and a role model for her community.",
