        "name": "Maya Leinenbach",
        "descriptionDe": "Maya Leinenbach ist Deutschlands reichweitenstärkste vegane Food-Bloggerin. Aktuell zählt ihr Instagram-Account über 1,1 Millionen Abonnent:innen – Tendenz stark steigend. Dabei waren es vor genau einem Jahr gerade mal 70.000 Follower. Das Erfolgsrezept? Sie setzt voll auf das Format Instagram Reels und verpackt ihre Rezepte in kurze, täglich veröffentlichte Clips. Einige der Videos kommen so in kürzester Zeit mehrere Millionen Views. Dank der großen Reichweite konnte sich Maya außerdem einen großen Traum erfüllen: Sie hat gerade ihr erstes eigenes Kochbuch herausgebracht.",
        "descriptionEn": "Maya Leinenbach is Germany’s most-popular vegan blogger. With over 1.1 million subscribers on Instagram, a far cry from the 70k she had this time last year. How? Her success can be primarily traced back to Instagram Reels and to recipes, appearing daily in brief, snackable clips. The top-performing videos of hers are wont to crack the million-views mark in no time at all. Thanks to her massive reach, Maya has fulfilled one of her lifelong dreams: writing her own cookbooks with her mom.",
