        "name": "Alexandra Geese",
        "descriptionDe": "Alexandra Geese kannte das Europa-Parlament bereits vor ihrer Zeit als Abgeordnete – immerhin hat sie hier jahrelang als Dolmetscherin gearbeitet. Inzwischen sind es ihre Beiträge, die übersetzt werden. Seit 2019 sitzt sie als Mitglied der Fraktion Die Grünen/EFA im Parlament und kümmert sich dort federführend um den Digital Services Act. Mit dem Gesetz will die EU die Rechte der Bürger in der digitalen Welt besser schützen. Alexandra Geese ist in Bonn aufgewachsen, doch nach dem Abitur zog es sie für mehrere Jahre nach Italien, wo sie als Konferenzdolmetscherin arbeitete – und im Laufe der Zeit unter anderem die Worte des früheren Papstes Benedikt, des Ex-Bundeskanzlers Helmut Kohl oder des Schriftstellers Umberto Eco übersetzte.",
        "descriptionEn": "Alexandra Geese was a long-serving interpreter for the European Parliament, before being elected as member of parliament. Since 2019, she has been a member of the Green Party in Germany, for whom she primarily handles all things pertaining to the Digital Services Act, the piece of landmark legislation designed to bolster the legal digital framework in Europe.",
