        "name": "Axel Hefer",
        "descriptionDe": "Axel Hefer ist Vorstandschef der Düsseldorfer Hotel-Suchmaschine Trivago. Den Posten hatte er 2020 als Nachfolger von Gründer Rolf Schrömgens übernommen, nachdem er zuvor bereits als Finanzvorstand den Börsengang begleitet hatte. Trivago ist seit 2016 an der US-Börse Nasdaq notiert. Genau wie die Trivago-Gründer hat der 44-jährige Axel Hefer in Leipzig an der HHL studiert. Nach Stationen bei der Beratung McKinsey und dem Private-Equity-Fonds Permira übernahm er zwischenzeitlich auch den Posten des Finanzchefs beim Online-Möbelhändler Home24. 2021 übernahm er neben dem Posten als Trivago-Chef auch noch einen weiteren Job: Hefer wurde zum Aufsichtsratsvorsitzenden des FC Schalke 04 gewählt. ",
        "descriptionEn": "Axel Hefer is chairman of the board at Trivago, the Düsseldorf-based hotel search engine. Heifer was appointed to the role in 2020, taking over for founder Rolf Schrömgens. Trivago has been listed on the NASDAQ since 2016. In 2021, Hefer took on another role in addition to board chairman at Trivago: chairman of the board at German football club FC Schalke 04.",
