        "name": "Vinod Kumar",
        "descriptionDe": "Vinod Kumar ist seit dem Juli 2019 CEO von Vodafone Business und Vorstandmitglied von Vodafone. Er zeichnet für Vodafones globales B2B-Geschäft verantwortlich.  Vinod verfügt über 30 Jahre Erfahrung in der Telekommunikationsbranche, die in diversen Funktionen rund um die ganze Welt gesammelt hat. Vor seinem Einstieg bei Vodafone war er CEO und Managing Director beim indischen Telko-Konzern Tata Communications. Davor war er für Asia Netcom tätig.",
        "descriptionEn": "Vinod Kumar was appointed CEO, Vodafone Business and member of the Executive Committee on 8 July 2019 with effect from 2 September 2019, reporting to Group CEO Nick Read. He is responsible for Vodafone’s business to business operations globally.  Vinod brings over 30 years of telecommunications experience to Vodafone, gained in a wide variety of global roles spanning Europe, Asia Pacific and the Americas. Most recently, Vinod was Chief Executive Officer and Managing Director of Tata Communications, where he first joined as its Chief Operations Officer in 2004.  Prior to Tata Communications Vinod was Senior Vice President at Asia Netcom, where he was actively involved in the asset sale of Asia Global Crossing to China Netcom, resulting in the formation of Asia Netcom.  Vinod holds a BSc in Electrical and Electronic Engineering and throughout his career has had a passion for creating and developing high performance teams.",
