        "name": "Mengting Gao",
        "descriptionDe": "Mengting Gao ist nicht nur CEO und Gründerin von Kitchen Stories, einer der erfolgreichsten Koch-Apps Deutschlands, sondern auch Investorin, Mentorin und begeisterte Köchin. 2013 vereinte sie ihre Leidenschaften für gutes Essen, anspruchsvolles Design und innovative Technologie und gründete gemeinsam mit ihrer Kommilitonin Verena Hubertz die digitale Kochplattform Kitchen Stories. Neun Jahre später verzeichnet allein die App 22 Millionen Downloads in über 150 Ländern. 2017 hat nicht nur Apple-CEO Tim Cook das Kitchen-Stories-Team in Berlin besucht, sondern auch die Bosch-Tochter BSH die Mehrheit an dem Unternehmen übernommen.",
        "descriptionEn": "Mengting Gao is not only CEO and founder of Kitchen Stories, one of Germany's most successful cooking apps, but also an investor, mentor and passionate cook. In 2013, she combined her passions for good food, sophisticated design and innovative technology by co-founding Kitchen Stories, a digital cooking platform. Nine years later, the app alone has 22 million downloads in over 150 countries. In 2017, not only did Apple CEO Tim Cook visit the Kitchen Stories team in Berlin, but Bosch subsidiary BSH also acquired a majority stake in the company.",
