        "descriptionDe": "Philipp Klöckner ist einer der renommiertesten Tech- und Marketingexperten in der deutschen und europäischen digitalen Wirtschaft. In den letzten 15 Jahren hat er als Berater und zum Teil als Business Angel an über 100 Startups und Wachstumsunternehmen mitgewirkt, von denen ein gutes Dutzend den begehrten Unicorn-Status erreichten. Seine Karriere begann im Jahr 2005 beim Preisvergleichsdienst Idealo; es folgten Stationen bei diversen Rocket-Internet-Startups. Seit 2017 berät Top Tier Private-Equity-Firmen wie KKR, Venture Capital Fonds und Wachstumsunternehmen. Seit Mitte 2020 spricht er im Doppelgänger Podcast gemeinsam mit Unternehmer Philipp Glöckler über aktuelle Ereignisse und Entwicklungen in der Tech-Branche. Bei den mitterweile zweimal wöchentlich erscheinenden Folgen hören mehr als 30.000 Menschen zu.",
