        "name": "Oliver Blume",
        "descriptionDe": "Seit 2015 ist Oliver Blume Vorstandsvorsitzender der Dr. Ing. h.c. F. Porsche AG. 2018 wurde ihm zusätzlich die Verantwortung für die Konzernproduktion innerhalb des Volkswagen Konzernvorstands übertragen. Der promovierte Maschinenbauer ist ein ideales Beispiel dafür, dass auch Automanager mittlerweile multimodal und nachhaltig unterwegs sind. In Großstädten fahre er auch gern mal Bus, U-Bahn oder E-Roller, sagte Blume neulich in einem Interview. Und wenn er doch in einem Auto sitzt, so wird der immer seltener ausschließlich von Benzin angetrieben. Erklärtes Ziel des CEO: 2030 sollen mehr als 80 Prozent der ausgelieferten Porsche vollelektrisch unterwegs sein.",
        "descriptionEn": "Since 2015, Oliver Blume has been Chairman of the Executive Board at Porsche and in 2018 was appointed to the Volkswagen Group Board of Management. Blume is a prime example of how automotive managers can succeed in adopting, implementing and embodying multimodal and sustainability mobility. Whenever he’s in a big city, he’s happy to take the bus, subway or scooter, as he recently said in an interview. And if he is behind the wheel, it’s rarely in a purely gas-powered automobile. His stated goal: to have more than 80% of all Porsches be completely electric by 2030.",
