        "descriptionDe": "Kann das wirklich funktionieren? Man trinkt Wasser und weil man gleichzeitig an einer Cola-Duftkapsel riecht, schmeckt das Wasser nach Cola? Der Erfolg des Münchner Startups Air Up zeigt: das funktioniert. 2016 hatte Produktdesignerin Lena Jüngst das Konzept der Air-Up-Flasche und der dazugehörigen \"Duft-Pods\" im Rahmen einer Bachelor-Arbeit entwickelt. Gemeinsam mit Mitgründer Tim Jäger macht sie daraus ein Unternehmen, das mittlerweile fast 70 Millionen US-Dollar Investorengelder eingesammelt hat. Einer der größten Investoren: Pepsi.",
