        "name": "Gabor Steingart",
        "descriptionDe": "Journalisten, die Unternehmer werden, gibt es in Deutschland nicht allzuviele. Einer, der diesen Weg wohl mit am erfolgreichsten eingeschlagen hat, ist Gabor Steingart: Nachdem er (nach Stationen bei der Wirtschaftswoche und dem Spiegel) beim Handelsblatt zunächst Chefredakteur und dann Vorsitzender der Geschäftsführung wird, dann aber wegen Meinungsverschiedenheiten mit Verleger Dieter von Holtzbrinck entlassen wird, gründet er 2019 die Pioneer Publishing GmbH. Mit der ungewöhnlichen Idee eines Redaktionsschiffes erregt er Aufmerksamkeit; der Axel Springer Verlag wird Minderheitsanteilseigner. Heute wird sein Newsletter \"Morning Briefing\" nach eigenen Angaben von mehr als 200.000 Menschen täglich gelesen; sein Podcast verzeichnet pro Woche eine Million Streams. Steingart ist damit einer der wichtigsten Meinungsmacher der Berliner Republik.",
        "descriptionEn": "There are not all that many journalists in Germany who end up being entrepreneurs. Gabor Steingart is one very successful exception. After his tenure as Editor-in-Chief at Handelsblatt, he founded Pioneer Publishing in 2019. Thanks to his atypical idea to launch an Editorial boat, he generated a massive amount of awareness and Axel Springer Verlag joined with a minority stake. Today, his newsletter “Morning Briefing” is read by more than 200,000 people every day and his podcast is streamed over 1 million times—making Steingart one of the most-influential voices in Berlin.",
