        "name": "Richard David Precht",
        "descriptionDe": "Würde man in Deutschland auf der Straße Passanten fragen, welcher Name ihnen beim Stichwort \"zeitgenössischer Philosoph\" einfällt – vermutlich würden 9 von 10 Menschen Richard David Precht nennen. Mit seinem Buch \"Wer bin ich – und wenn ja, wie viele?\" gelang ihm 2007 der endgültige Durchburch; nach wie vor hält der heute 51-Jährige damit den Langzeitrekord auf der Bestsellerliste des Spiegels. Mittlerweile hat Precht 17 Bücher veröffentlicht; zuletzt haben sich seine Werke verstärkt mit Themen wie künstlicher Intelligenz und digitaler Revolution auseinandergesetzt. Precht ist regelmäßig im Fernsehen zu sehen – als Talkshow-Gast oder Gastgeber in seiner eigenen Sendung Precht. Seit 2021 ist er gemeinsam mit Markus Lanz Gastgeber im Podcast Lanz & Precht.",
