        "name": "Mareike Jacobsgaard",
        "descriptionDe": "Mareike Jacobsgaard ist seit 2019 bei ABOUT YOU und war seitdem für verschiedenste Fokus Projekte verantwortlich. Nach Leitung von Country Launch Kampagnen und der Marketing-Steuerung von AY‘s exklusiven Personal Brands, baut sie seit Anfang des Jahres ein neues Team rund um Live Shopping auf. In Zusammenarbeit mit Influencern, Künstlern und Marken soll dieser neue Marketing Channel in kürzester Zeit international skaliert werden. Bevor sie bei ABOUT YOU anfing, hat sie u.a. auf Beratungs-, Corporate- und Agenturseite gearbeitet und in Münster, Dublin und Hamburg studiert.",
        "descriptionEn": "Mareike Jacobsgaard joined ABOUT YOU in 2019 and was since then responsible for different key projects. After leading country launch campaigns and the marketing steering for AY’s exclusive personal brands, she is now building a new team with focus on Live Shopping. In cooperation with influencers, content creators and brands, the goal is to scale this marketing channel as quickly as possible at an international level. Before joining ABOUT YOU, she worked in a consultancy, as well as in corporates and agencies, and studied in Münster, Dublin and Hamburg.",
