        "name": "Mikko Hyppönen",
        "descriptionDe": "Mikko Hyppönen hat ein Buch geschrieben, dessen Titel ganz gut beschreibt, womit sich der Finne einen Großteil seiner Zeit beschäftigt. Es heißt einfach nur „Internet“. Und Mikko Hyppönen blickt viel auf die Schattenseiten dieser Errungenschaft, immerhin gilt er als einer der bekanntesten Cyber-Security-Experten der Welt. Seit mehr als 20 Jahren arbeitet er als Chief Research Officer für das Cyber-Security-Unternehmen WithSecure (früher: F-Secure). Seine Expertise hat er allerdings auch schon in einem TED-Talk unter Beweis gestellt – sowie als Dozent in Stanford, Cambridge oder Oxford. Sogar das Europa-Parlament hat er bereits in Cyber-Sicherheitsfragen beraten.",
