        "name": "Ann Cathrin Riedel",
        "descriptionDe": "Ann Cathrin Riedel hat keine Angst vor großen Aufgaben – das konnte man 2021 beobachten. Damals trat sie bei der Bundestagswahl für die FDP in Berlin ausgerechnet in dem Wahlkreis an, in dem Hans-Christian Ströbele in der Vergangenheit bei vier Wahlen in Folge als einziger Grünen-Politiker bundesweit ein Direktmandat gewinnen konnte. Auch 2021 gewann ein Grüner, doch die Digitalpolitikerin Riedel konnte das Ergebnis ihrer Partei deutlich auf fünf Prozent verbessern. Das liegt wohl auch daran, dass die Vorsitzende des digitalpolitischen Vereins „Load – Verein für liberale Netzpolitik\" seit Jahren eine Vorkämpferin für digitale Bürgerrechte ist. Das Magazin „Capital“ zeichnete sie 2020 als „Junge Elite“ – Deutschlands Top 40 unter 40 im Bereich „Wissenschaft und Gesellschaft“ aus. Hauptberuflich arbeitet Ann Cathrin Riedel als Themenmanagerin für „Digitalisierung und Innovation“ bei der Friedrich-Naumann-Stiftung.",
        "descriptionEn": "Ann Cathrin Riedel is not one to shy away from massive challenges—as 2021 showed. Last year, she ran for office in Berlin where her opponent was a four-term incumbent. She won. She is a champion of digital political topics and was named to the top 40 of Germany’s elite.",
