        "name": "Andreas Dondera",
        "descriptionDe": "Wenn Andreas Dondera ins Spiel kommt, ist das oft kein gutes Zeichen. Denn der Hamburger leitet beim Landeskriminalamt Hamburg die Zentrale Ansprechstelle Cybercrime (ZAC). Diese berät einerseits die Hamburger Wirtschaft in Sachen IT-Sicherheit, kommt aber umgekehrt auch dann ins Spiel, wenn Unternehmen Opfer einer Cyber-Attacke geworden sind. Seine Karriere bei der Polizei begann Andreas Dondera bereits 1987, mehrere Jahre arbeitete er unter anderem als Dozent an der damaligen Fachhochschule für Öffentliche Verwaltung in der Hansestadt. Inzwischen arbeitet er seit mehr als zehn Jahren als Ermittler und IT-Forensiker im Bereich Cybercrime. ",
        "descriptionEn": "When Andreas Dondera enters the picture, it’s rarely a good sign. Dondera headed up the Zentrale Ansprechstelle Cybercrime (ZAC) (Center for Cyber Crime) in Hamburg. The ZAC advises Hamburg businesses on IT security, but also shows up when companies fall victim to a cyber attack. His career with the police began in 1987, taught at the police school in Hamburg and has been active as a detective and forensic investigator for cyber crime.",
