        "name": "Sven Weizenegger",
        "descriptionDe": "Sven Weizenegger leitet seit Juni 2020 den Cyber Innovation Hub der Bundeswehr – die digitale Innovationseinheit der deutschen Streitkräfte. Der Hub ist die erste militärische digitale Innovationseinheit in Europa. Damit ist der 40-Jährige eine der zentralen Figuren, wenn es um die Modernisierung der Bundeswehr geht. Sven Weizenegger war davor in verschiedenen Konzernen und Startups tätig – unter anderem bei der Deutschen Telekom, wo er als erster offizieller Hacker Karriere gemacht hat. Anschließend baute er vor seinem Wechsel zur Bundeswehr als Mitgründer und Geschäftsführer den Cybersicherheitsspezialisten Perseus auf.",
        "descriptionEn": "Sven Weizenegger has headed up the cyber innovation hub for the German Armed Forces since June 2020. The hub is the first military digital innovation department in Europe. Weizenegger is a central figure in the modernization of the German military. Before taking n the role, Weizenegger was active for several startups, including Deutsche Telekom, where he was the first-ever official ex-hacker to work for the company.",
